# Rescursive solution based (initial attempt)
# Will explode Stack
def morganAndStringRecursive(a, b):
    # Base case
    if len(a) == 0 and len(b) == 0:
        return ''

    # If either list has depleted fully, add remaining elements from other list to resultant string
    if len(a) == 0:
        return b
    elif len(b) == 0:
        return a

    # A stack is lower lexicographically
    if a[0] < b[0]:
        return a[0] + morganAndStringRecursive(a[1:], b)
    # B Stack is lower lexicographically
    elif b[0] < a[0]:
        return b[0] + morganAndStringRecursive(a, b[1:])
    # Same lexicographically value
    else:
        # Thus we have to lookahead to see which option will end up being the better choice
        # We will do this by evaluating both options and picking one with minimum result lexicographically
        return min(a[0] + morganAndStringRecursive(a[1:], b), b[0] + morganAndStringRecursive(a, b[1:]))

# Morgan and String
# Time Complexity: O(N+M)
# Space Complexity: O(N+M), sum of length of both input strings stored as result
def morganAndString(a, b):
    
    result = ''

    while len(a) > 0 or len(b) > 0:

        # If either list has depleted fully, add remaining elements from other list to resultant string
        if len(a) == 0:
            return result + b
        elif len(b) == 0:
            return result + a

        # A element is lower lexicographically
        if a[0] < b[0]:
            result += a[0]
            a = a[1:]
        # B element is lower lexicographically
        elif b[0] < a[0]:
            result += b[0]
            b = b[1:]
        # Same lexicographically value
        else:
            # Thus we have to lookahead to see which option will end up being the better choice
            # We will do this by finding first two elements which don't match and pick path that leads to lowest element lexicographically
            for i, _ in enumerate(zip(a, b)):
                if a[i] != b[i]:
                    # At this point, one of the elements must be lower
                    # Add all the element including that element to the result    
                    if a[i] < b[i]:
                        result += a[:i+1]
                        a = a[i+1:]
                    elif b[i] < a[i]:
                        result += b[:i+1]
                        b = b[i+1:]

                    break
            else:
                # Edge case: If we hit the end of either list we should always pick element from opposite list
                if i == len(a) - 1:
                    result += b[0]
                    b = b[1:]
                elif i == len(b) - 1:
                    result += a[0]
                    a = a[1:]

    return result


# Unit Tests
def unit_tests():
    # Test 1
    a = 'ACA'
