    testing_morgan_and_string(a, b, expected)

    # # Test 6
    a = 'BBBABB'
    b = 'BBBABA'
    expected = 'BBBABABBBABB'
    testing_morgan_and_string(a, b, expected)

    # Test 7
    a = 'SLWNABIDOZABZ'
    b = 'ZUQZZ'
    expected = 'SLWNABIDOZABZUQZZZ'
    testing_morgan_and_string(a, b, expected)

    # Test Case 8
    a = 'CATZA'
